import 'dart:async';
import 'dart:convert';
import 'dart:typed_data';

import 'package:embeddings_explorer/interop/libsql.dart' as libsql;
import 'package:embeddings_explorer/util/logging.dart';
import 'package:logging/logging.dart';

StreamSubscription<LogRecord> setupTests() {
  final sub = configureLogging(level: Level.ALL, isTest: true);
  return sub;
}

Uri get testLibsqlUri => Uri.parse(
  'https://unpkg.com/@libsql/libsql-wasm-experimental@0.0.3/index.mjs',
);

Future<void> loadLibsql() async {
  await libsql.loadModule(moduleUri: testLibsqlUri);
}

/// A test database generated with the following SQL commands:
///
/// ```sql
/// CREATE TABLE test_table(id INTEGER PRIMARY KEY AUTOINCREMENT, name TEXT);
///
/// INSERT INTO test_table(name) VALUES ('Test Item 1'), ('Test Item 2');
/// ```
// NOTE: Creates a new Uint8List each time to avoid issues with reusing the
// same buffer (which may be transferred to workers).
Uint8List get testDbData => base64Decode(
  '',
);
